import { useContext } from "react"
import { AppContext } from "../../context/AppContext"

const CartNav = () => {
    const [cart, setCart] = useContext(AppContext)
  return (
      <>
          Cart {cart && cart.totalProductsCounts ? cart.totalProductsCounts : 0}
      </>
  )
}

export default CartNav
